DROP TABLE tk_sales_main;

CREATE TABLE `tk_sales_main` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(150) NOT NULL,
  `year` int(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;




DROP TABLE tk_sales_sub;

CREATE TABLE `tk_sales_sub` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `main_id` int(20) NOT NULL,
  `tab_name` varchar(200) NOT NULL,
  `month` varchar(20) NOT NULL,
  `temp` varchar(20) NOT NULL,
  `row_no` int(200) NOT NULL,
  `no1` varchar(200) NOT NULL,
  `no2` varchar(200) NOT NULL,
  `no3` varchar(200) NOT NULL,
  `no4` varchar(200) NOT NULL,
  `no5` varchar(200) NOT NULL,
  `no6` varchar(200) NOT NULL,
  `no7` varchar(200) NOT NULL,
  `no8` varchar(200) NOT NULL,
  `no9` varchar(200) NOT NULL,
  `no10` varchar(200) NOT NULL,
  `no11` varchar(200) NOT NULL,
  `cf` int(200) DEFAULT NULL,
  `ss_undo` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3015 DEFAULT CHARSET=latin1;




